import { Button, Header, Image, Modal } from 'semantic-ui-react'

function Signin({openModal, setOpenModal}) {

  return (
    <Modal
      onClose={() => setOpenModal(false)}
      onOpen={() => setOpenModal(true)}
      open={openModal}
    >

    </Modal>

    )
}

export default Signin
